INSERT INTO `iw_pages` VALUES ('1', 'درباره', '<p>سایت گهر از سال 1390 در حوزه ارسال پیام فعالیت داشته است.</p>\r\n\r\n<p>ابتدای امر با اخذ نمایندگی از سایت ها و شرکت های معتبر شروع کرده ایم و در حال حاضر مستقلا فعالیت مینماییم و ان شا الله روز به روز موجب جلب رضایت بیشتر شما خواهیم شد</p>\r\n\r\n<p>برنامه اینده ما تولید اپلیکیشن اندرودی سایت و امکان ثبت نمایندگی است.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><img alt=\"\" src=\"http://gohar.org/tarsim/images/Gohar-logo.png\" style=\"height:329px; width:313px\" /></p>\r\n', 'about');
